import { FETCH_SONGS_POPULAR } from "./types";

export const fetch_songs_popular = () => dispatch => {
  axios;
  console
    .log("fetching")
    .get("https://jsonplaceholder.typicode.com/todos")
    .then(res => res.json())
    .then(songs_popular =>
      dispatch({
        type: FETCH_SONGS_POPULAR,
        payload: songs_popular
      })
    )
    .then()
    .catch(err => console.log(err));
};
